// About.js
import React from 'react';

const About = () => {
  return (
    <div className="container">
      <h2>About Pic Morpher</h2>
      <p>
        Welcome to Pic Morpher, a platform that allows you to transform and morph your pictures
        in creative ways. Whether you're looking to add special effects, filters, or simply
        have fun with your photos, Pic Morpher has you covered.
      </p>
      <p>
        Our mission is to provide a user-friendly experience for enhancing and morphing images.
        Feel free to explore the features and let your creativity shine!
      </p>
    </div>
  );
};

export default About;
